CREATE TABLE VWINVPROSUBPROYECTO (
  NUMIDPROYECTO     		INT   			NOT NULL COMMENT 'Identificador del proyecto global asociado al proyecto',
  NUMIDSUBPROYECTO  		INT				NOT NULL COMMENT 'Identificador del proyecto',
  STRCODIGOSUBPROYECTO		VARCHAR(14)		NOT NULL COMMENT 'Código del proyecto', 
  STRTITULO					VARCHAR(2000)	NOT NULL COMMENT 'Título del proyecto', 
  STRREFERENCIAEXTERNA		VARCHAR(50)		COMMENT 'Referencia externa del proyecto', 
  STRREFERENCIAINTERNA		VARCHAR(100)	COMMENT 'Referencia interna del proyecto', 
  STRDESTIPOSBP				VARCHAR(100)	NOT NULL COMMENT 'Tipo del proyecto', 
  STRDESSUBTIPOSBP			VARCHAR(100)	COMMENT 'Subtipo del proyecto',   
  DATFECHAINICIO			DATE			NOT NULL COMMENT 'Fecha de inicio del proyecto', 
  DATFECHAFINREAL			DATE 			NOT NULL COMMENT 'Fecha fin real del proyecto', 
  DATRESOLUCIONCONVOCATORIA	DATE			COMMENT 'Fecha de resolución de la convocatoria', 
  DATFIRMA					DATE			COMMENT 'Fecha de la firma del proyecto', 
  STRNOMBREENTFIN			VARCHAR(255)	NOT NULL COMMENT 'Nombre de la entidad financiadora del proyecto',
  STRDESCV1					VARCHAR(500)	COMMENT 'Descripción de la convocatoria asociada al proyecto',
  PRIMARY KEY (NUMIDPROYECTO, NUMIDSUBPROYECTO),
  UNIQUE INDEX PROYECTOS_UK (STRCODIGOSUBPROYECTO)
) COMMENT 'Tabla que contiene los datos de los proyectos necesarios de UXXI-INV';


COMMIT;
